function add(a,b) {
    let sum = a+b;
    return sum;
}

function sub(a,b) {
    let sub = a-b;
    return sub;
}

function mult(a,b){
    let mul = a*b;
    return mul;
}

function div(a,b){
    let div = a/b;
    return div.toFixed(2);
}

function per(a,b){
    let per = a%b;
    return per;
}

export {add, sub, mult, div, per};
